    new Compressor(originalFile, {
      quality: 0.5,
      maxWidth: 400,
      maxHeight: 350,
      checkOrientation: false,
      success: (result) => {
        console.log("Compression successful");
        resolve(result); // This will return the compressed file
      },
      error: reject,
    });
